import { StyleSheet } from 'aphrodite/no-important'

export default StyleSheet.create({
  wrapper: {
    background: 'linear-gradient(90deg,#db4454,#9f406d)',
    fontSize: 12,
    padding: '3px 12px',
    color: '#fff',
    margin: '4px 0'
  }
})
